function [T,Y,te,ye,ie] = rock4(fcn,tspan,y0,options)
%-------------------------------------------------------------------------
% This is a MATLAB-implementation of ROCK4 (Abdulle & Medovikov)
% for the  numerical solution of a (mildly) stiff system  
% of first order differential equations  ODEs y'=f(t,y). 
%
% ROCK4 is based on a family of second order explicit Runge-
% Kutta methods with nearly optimal stability domain 
% on the negative real axis. The numerical method is 
% based on a three-term recursion relation.
% The size (along the negative axis) of the stability 
% domains increases quadratically with the stage number.
%
% Intended for problems of large dimensions with
% eigenvalues of the Jacobian close to the negative
% real axis. Typically for problems originating from parabolic PDEs.
%
% Usage is the same as ode23s:
%    [TOUT,YOUT] = rock4(ODEFUN,TSPAN,Y0)  or
%    [TOUT,YOUT] = rock4(ODEFUN,TSPAN,Y0,OPTIONS)  or
%    [TOUT,YOUT,TE,YE,IE] = rock4(ODEFUN,TSPAN,Y0,OPTIONS)
%
% These options are implemented (see help odeset):
%
%       RelTol, AbsTol, Stats, InitialStep, MaxStep, Mass, Jpattern, OutputFcn
%       
% This option is partly implemented:
%
%       Events (direction not implemented, only one event at a time)
%
%
% For large problems the usage of the option "Jpattern" is recommended.
%
%
% BIBLIOGRAPHY:
%  [1] Hairer, Wanner:  Solving Ordinary Differential Equations II, second ed., 
%       Springer, Berlin, 1996.
%  [2] A. Abdulle & A.A. Medovikov
%        Second order Chebyshev methods based on
%        orthogonal polynomials
%        To appear in Numer. Math.
%        http://www.unige.ch/math/biblio/preprint/liste.html
%
%
% comments are welcome to
% Gerd Steinebach (Gerd.Steinebach@fh-brs.de), version 6.2006
%
%-------------------------------------------------------------------------
global first_fcn_eval  % =1 if first fcn-eval in step, =0 otherwise

persistent tlastevent

%-- Initialization --------------------
if nargin < 4
    options = [];
    if (nargin < 3) error('Error exit: not enough input arguments');  end
end

%---- implemented options -----------------
rtol = odeget(options,'RelTol',1e-3);
atol = odeget(options,'AbsTol',1e-6);
statson = odeget(options,'Stats','off');
hinit = odeget(options,'InitialStep',[]);
hmax = odeget(options,'MaxStep',[]);
M = odeget(options,'Mass',[]);
Jacstru = odeget(options,'Jpattern',[]);
solout=odeget(options,'OutputFcn',[]);
events=odeget(options,'Events',[]);
stats = struct('nfevals',0,'nsteps',0,'nrejected',0,'npds',0,'ndecomps',0,'nsolves',0);

neq = length(y0); 

%--- Parameter -------------
 true = 1; false = ~true; 
 uround=eps; fac1=0.2; fac2=2.0;                     % could be altered
 FACNJ=[]; Jacspace=[]; thresh=ones(neq,1)*1.0e-12;  % for numjac

%-- Method's coefficients
[ms,fpa,fpb,fpbe,recf]=coeff_rock4;
 
%----- Mass Matrix, Jpattern
if isempty(M)
    M=speye(neq);
else
    if (issparse(M)==0) M=sparse(M); end
end
if isempty(Jacstru)
   Jacstru = sparse(ones(neq));
else
   if (issparse(Jacstru)==0) Jacstru=sparse(Jacstru); end
end

% --Preparations for output-parameter [T,Y], solout, events ------------
 t0=tspan(1); tend=tspan(end); y(:,1) = y0; t=t0; T=t0; Y=y'; 
 dense_output=false; n_tspan=length(tspan); told=t0;
 if n_tspan > 2 
     dense_output=true; inext=2; tnext=tspan(inext);
 end
 if isempty(solout)==0
     if solout([t0,tend],y0,'init')==1 return; end
 end
 if isempty(events)==0
     [value,isterminal,direction]=events(t,y);
     if isempty(tlastevent) | (tlastevent > t)  tlastevent=t-1.0;  end
 end
 te=[];ye=[];ie=[];
     
%-- INITIAL PREPARATIONS for stepsize --------
 if (tend <= t0) error('tend<= t0 !!'); end
 if isempty(hmax) hmax=abs(tend-t0); end
 if isempty(hinit) hinit=1.0e-6*abs(tend-t0); end
 h=min(hinit,hmax);  
 
%-- The main integration loop ---------------------------------------------
 err=-1.0; h_old=h;
 done = false;  reject = false;
 mdego=0; nrho = 0; facmax = fac2;
 istage = 1; stage(1)=0; fail_rock=0;
 while ~done
    if (t+0.1*h == t) | (abs(h) <= uround)    % stepsize to small
        fprintf('Error exit of ROCK4 at time t=%15g: step size to small h=%15g \n',t,h);
        break
    end
    if (t+h) >= tend
       h=tend-t;
    else
       h=min(h,0.5*(tend-t));
    end
%---- integration step --------
    if reject==false
      first_fcn_eval = 1;  
      f0 = feval(fcn,t,y);  stats.nfevals=stats.nfevals+1; 
      first_fcn_eval = 0;  
    end
    rho_is_new = false;
    if (nrho==0)
      [DFDY,FACNJ,Jacspace,nf] = numjac(fcn,t,y,f0,thresh,FACNJ,0,Jacstru,Jacspace);
      stats.npds=stats.npds+1; stats.nfevals=stats.nfevals+nf; 
% -------- Spectral radius.--------
%      if (neq > 1) 
      if (0 == 1) 
        opts.disp=0; opts.tol=rtol; eigmax=eigs(DFDY,1,'LM',opts);
        eigmax=abs(eigmax);
      else
        eigmax=max(sum(abs(DFDY)));
      end
      rho_is_new = true;
    end  
    nrho = nrho + 1; if (nrho==25) nrho=0; end
% -------- The number of stages.--------
    mdeg=round(sqrt((3.d0+h*eigmax)/0.353d0)+1);
    if (mdeg>50) nrho=0; end
    if (mdeg > 152) 
        h=0.8d0*(152.d0^2*0.353d0-3.d0)/eigmax;
        mdeg=152;
    end
    mdeg=max(mdeg,5)-4;
    if (mdeg~=mdego) 
        [mdeg,mp]=mdegr(mdeg,ms); 
        mz=mp(1);mr=mp(2);
    end
%-- Integration step
% -------- First stage.--------
      temp1=h*recf(mr); ci1=t+temp1; ci2=ci1; ci3=t;
      yjm2=y; yjm1=y+temp1*f0;
      if (mdeg<2) ynew=yjm1; end
% --------- Stages for j=2..mdeg.--------
      for i=2:mdeg
        temp1=h*recf(mr+2*(i-2)+1);temp3=-recf(mr+2*(i-2)+2); temp2=1.d0-temp3;
        ynew=feval(fcn,ci1,yjm1); ci1=temp1+temp2*ci2+temp3*ci3;
        ynew=[ynew,yjm1,yjm2]*[temp1;temp2;temp3];
% -------- Shift the value "y" for the next stage.--------
        if (i<mdeg) 
            yjm2=yjm1; yjm1=ynew;
        end
        ci3=ci2; ci2=ci1;
      end
% -------- The finishing procedure (4-stage method).
% -------- Stage 1.--------  
      temp1=h*fpa(mz,1);
      yjm1 = feval(fcn,ci1,ynew);
      yjm3=ynew+temp1*yjm1;
% -------- Stage 2.--------    
      ci2=ci1+temp1;
      temp1=h*fpa(mz,2); temp2=h*fpa(mz,3);
      yjm2 = feval(fcn,ci2,yjm3);
      yjm4 =ynew+temp1*yjm1+temp2*yjm2;
% -------- Stage 3.--------
      ci2=ci1+temp1+temp2;
      temp1=h*fpa(mz,4); temp2=h*fpa(mz,5);  temp3=h*fpa(mz,6);
      yjm3 = feval(fcn,ci2,yjm4);
      fnt = ynew+temp1*yjm1+temp2*yjm2+temp3*yjm3;
% -------- Stage 4.--------
      ci2=ci1+temp1+temp2+temp3;
      temp1=h*fpb(mz,1); temp2=h*fpb(mz,2);
      temp3=h*fpb(mz,3); temp4=h*fpb(mz,4);
      yjm4 = feval(fcn,ci2,fnt);
      ynew = [ynew,yjm1,yjm2,yjm3,yjm4]*[1;temp1;temp2;temp3;temp4];
% -------- Error evaluation (embedded method of order 3).--------
      temp1=h*fpbe(mz,1)-temp1; temp2=h*fpbe(mz,2)-temp2;
      temp3=h*fpbe(mz,3)-temp3; temp4=h*fpbe(mz,4)-temp4; temp5=h*fpbe(mz,5);
      fnt = feval(fcn,t+h,ynew);
      yjm2 = [yjm1,yjm2,yjm3,yjm4,fnt]*[temp1;temp2;temp3;temp4;temp5];
%-- error
      errold=err;
      SK = atol + rtol.*max(y,ynew);
      err = sum( (yjm2./SK).^2 );
      err = sqrt(err/neq);
% --- ready
    mdego=mdeg;
    stats.nfevals=stats.nfevals+mdeg+4; 
%---- error test -----------
    h_old2=h_old; h_old=h;
    fac = 0.9 * err^(-0.25);
    if (errold>=0)&(reject==false)
        fac_pred=(errold/(err+eps))^0.25*h/h_old2;
        if (fac_pred<1) fac=fac*fac_pred; end
    end
    fac=min(facmax,max(fac1,fac));
    hnew=h*fac;
    if err <= 1.0   % --- STEP IS ACCEPTED  -------
      reject = false; fail_rock=0;
      stats.nsteps=stats.nsteps+1; told = t; t=t+h; 
%-- events: is not implemented
%-- output
      if (dense_output==0) 
          T=[T;t]; Y=[Y;ynew']; 
          istage=istage+1; stage(istage)=mdeg;
         if isempty(solout)==0
           if solout(t,ynew,'')==1 return; end
         end
      else        %-- dense output: not yet implemented
      end
      if (abs(tend-t) < uround) done=true; end  %-- succesfull integration --
      y = ynew; facmax = fac2;
    else            % --- STEP IS REJECTED ------- 
      reject = true; fail_rock=fail_rock+1;
      if (rho_is_new==false) && (fail_rock >2) nrho =0; end
      stats.nrejected=stats.nrejected+1;  
      if (abs(hnew) >= abs(h)) hnew=0.1d0*h; end
      facmax = 1.0;
    end
    h=hnew;
%---------
 end
%---------
 if isempty(solout)==0
     status=solout(t,y,'done');
 end
%------------------
 if strcmp(statson,'on')
   fprintf('%g successful steps\n', stats.nsteps);
   fprintf('%g failed attempts\n', stats.nrejected);
   fprintf('%g function evaluations\n', stats.nfevals);
   fprintf('%g partial derivatives\n', stats.npds);
   fprintf('%g LU decompositions\n', stats.ndecomps);
   fprintf('%g solutions of linear systems\n', stats.nsolves);
 end
% plot(T,stage,'r'); hold on


function [mdeg,mp]=mdegr(mdeg1,ms)
%-------------------------------------------------------------          
%       Find the optimal degree.
%       MP(1): pointer which select the degree in ms(i)\1,2,..
%             such that mdeg<=ms(i).
%       MP(2): pointer which gives the corresponding position
%       of a_1 in the data recf for the selected degree.
% ---------------------------------------------- 
% -------- Find the degree.--------     
mp = zeros(2,1); mp(2)=1;
i=0; mdeg = mdeg1;
while i<50
   i=i+1;
   if ((ms(i)/mdeg)>=1) 
      mdeg=ms(i); mp(1)=i; i=50;
   else   
      mp(2)=mp(2)+ms(i)*2-1;
   end
end

